import React from "react"
import { HashLink as Link } from "react-router-hash-link";
import { Conteudo, Cabeçario } from "./styles"


export default function Header() {
    return (
        <Conteudo>
            <Cabeçario>
                <Link to="#inicio">Inicio</Link>
                <Link to="#sobre">Sobre</Link>
            </Cabeçario>
        </Conteudo>
    );
}
